$(document).ready(function(){$.ajax({type:"GET",url:"./pkm.json",dataType:"json",success:function(e){var t=e.configs,n=e.pkms;document.getElementById("title").innerText=t.title,document.getElementById("subtitle").innerText=t.subtitle;var i="";n.forEach(function(e){i+='<div class="'+e.div+'">',i+='<img src="'+e.img+'"/>',i+="<h4>"+e.num+"</h4>",i+="<h3>"+e.name+"</h3>",i+="</div>"}),document.getElementById("pkms").innerHTML=i}})});